import { CommonModule } from '@angular/common';
import {
  AfterContentInit,
  AfterViewInit,
  Component,
  ElementRef,
  OnInit,
  ViewChild,
} from '@angular/core';
import { FormsModule } from '@angular/forms';
import { IonicModule } from '@ionic/angular';
import {
  FindResultMatchesCount,
  FindState,
  NgxExtendedPdfViewerModule,
  NgxExtendedPdfViewerService,
  PagesLoadedEvent,
  PdfSidebarView,
  TextLayerRenderedEvent,
} from 'ngx-extended-pdf-viewer';

@Component({
  selector: 'app-custom-viewer',
  standalone: true,
  imports: [IonicModule, NgxExtendedPdfViewerModule, CommonModule, FormsModule],
  templateUrl: './custom-viewer.component.html',
  styleUrl: './custom-viewer.component.css',
})
export class CustomViewerComponent {
  sidebarOpen = true;
  sideBarView : PdfSidebarView = PdfSidebarView.THUMBS;
  handTool: boolean = false;
  _zoomSetting: number | string | undefined = 'page-width';
  currentZoomFactor: number | string | undefined = 'auto';
  currentPage: number = 1;
  maxPage: number = 1;
  public _searchtext = '';
  public currentMatchNumber: number | undefined;

  public totalMatches: number | undefined;

  findState: FindState | undefined;

  textLayer:boolean = true;

  constructor(
    private ngxExtendedPdfViewerService: NgxExtendedPdfViewerService
  ) {}

  enableTextSelection() {
    this.handTool = false;
  }
  enableHandTool() {
    this.handTool = true;
  }

  enableshowPresentationModeButton() {
    const element = document.getElementById('presentationMode');
    if (element) {
      element.click();
    }
  }

  showSidebarButton() {

    this.sidebarOpen = !this.sidebarOpen;
    // const element = document.getElementById('primarySidebarToggle');
    // if (element) {
    //   element.click();

    //   const elementThumbnail = document.getElementById('viewThumbnail');
    //   if (elementThumbnail) {
    //     elementThumbnail.click();
    //   }
    // }
  }

  zoomIn() {
    const element = document.getElementById('zoomIn');
    if (element) {
      element.click();
    }
  }

  zoomOut() {
    const element = document.getElementById('zoomOut');
    if (element) {
      element.click();
    }
  }

  onEnterFirstTextbox(event: KeyboardEvent | any) {
    const value = parseInt((event.target as HTMLInputElement).value);
    // Check if the key pressed is "Enter"
    if (event.key === 'Enter' && value <= this.maxPage) {
      // Set the value of the second text box
      this.currentPage = value;
    } else {
      this.currentPage = 1;
    }
  }

  onPagesLoaded(pagecount: PagesLoadedEvent): void {
    this.maxPage = pagecount.pagesCount;
  }

  downLoad() {
    const element = document.getElementById('download');
    if (element) {
      element.click();
    }
  }

  refresh() {
    this.currentPage = 1;
    this.currentZoomFactor = 'auto';
    this.handTool = true;
    this.textLayer = false;
  }

  public get searchtext(): string {
    return this._searchtext;
  }

  public set searchtext(text: string) {
    this._searchtext = text;
    this.find();
  }

  private find() {
    if (!this._searchtext) {
      this.findState = undefined;
      this.currentMatchNumber = undefined;
      this.totalMatches = undefined;
    }
    this.ngxExtendedPdfViewerService.find(this._searchtext);
  }

  updateFindState(result: FindState) {
    this.findState = result;
  }

  updateFindMatchesCount(result: FindResultMatchesCount) {
    this.currentMatchNumber = result.current;
    this.totalMatches = result.total;
  }

  findNext(): void {
    this.ngxExtendedPdfViewerService.findNext();
  }

  findPrevious(): void {
    this.ngxExtendedPdfViewerService.findPrevious();
  }

  public get findStateText(): string {
    switch (this.findState) {
      case FindState.FOUND:
        return 'found';
      case FindState.NOT_FOUND:
        return 'not found';
      case FindState.PENDING:
        return 'pending';
      case FindState.WRAPPED:
        return 'wrapped';
    }
    return '';
  }

  pdfData =
    'data:application/pdf;base64,';

    highlights: { text: string; position: DOMRect }[] = [];

    onTextLayerRendered(event: any): void {
      const textLayer = event.source.textLayer;
      this.captureHighlights(textLayer);
    }
  
    captureHighlights(textLayer: HTMLElement): void {
      //debugger
      try {
        const highlights = textLayer.querySelectorAll('.highlight');
      if(highlights){
        highlights.forEach((highlight: HTMLElement | any) => {
          const position = highlight.getBoundingClientRect();
          const text = highlight.innerText;
          this.highlights.push({ text, position });
          console.log(`Highlighted text: ${text}, Position:`, position);
        });
      }
      } catch (error) {
        
      }
      
     
    }
  
    highlightText(): void {
      debugger
      const selection = window.getSelection();
      if (selection && selection.rangeCount > 0) {
        const range = selection.getRangeAt(0);
        const text = selection.toString();
        if (text) {
          const highlightSpan = document.createElement('div');
          highlightSpan.classList.add('highlightEditor');
          highlightSpan.style.backgroundColor = 'yellow';
          highlightSpan.appendChild(range.extractContents());
          range.insertNode(highlightSpan);
  
          const position = highlightSpan.getBoundingClientRect();
          this.highlights.push({ text, position });
          console.log(`Highlighted text: ${text}, Position:`, position);
        }
      }
    }
}
